import React from 'react';
import styles from './RadioFilters.module.css'

const RadioFilters = () => {
    return (
        <fieldset>
            <legend className={styles.radioFilters__name}>Сортировка по :</legend>
            <div className={styles.radioFilters__dropdown}>
                
                <input type='radio' className={styles.radioFilters__container} id='sortPriceUp' />
                <label for='sortPriceUp'>По возрастанию цены</label>
                
            </div>
        </fieldset>
    );
};

export default RadioFilters;
